import React from 'react';
import '_logo.scss'

const Logo = () => {
    return (
        <div>
            <div className='logo'>
            <img className="Logo" src="./imgs/logo/logo1.png" alt="Groupomania" /></div>
        </div>
    );
};

export default Logo;
